import { PrismaClient } from '@prisma/client';

let tipi_utente, ruoli_utente;

// Istanzia il client per il SARP
const SARP = new PrismaClient();


async function load() {
    tipi_utente = await SARP.tipo_Utente.findMany({
        orderBy: [{ id: 'desc' }]
    });
    ruoli_utente = await SARP.ruolo_Utente.findMany({
        orderBy: [{ id: 'desc' }]
    });
}

async function create() {
    let nome = capital(random_item(nomi));
    let cognome = capital(random_item(cognomi));

    console.log(`Creazione utente ${nome} ${cognome}`);
    await SARP.Utente.create({
        data: {
            nome: nome,
            cognome: cognome,
            email: nome.concat(".", cognome, ".", Math.floor(Math.random() * 100), "@istitutoagnelli.it"),
            telefono: random_telefono(),
            tipo: random_item(tipi_utente).tipo,
            ruolo: random_item(ruoli_utente).ruolo,
            istituto: random_item(istituti),
            bes: false,
            picture: random_item(pictures)
        }
    });
}


async function main() {
    await load();
    for(let i = 0; i < 500; i++)    // Secondo me deve generare un numero definito di utenti per agevolare lo sviluppatore nella creazione
        create();
    // setInterval(() => create(), 30);
}

main()

function capital(str) {
    return str[0].toUpperCase() + str.slice(1);
}

function random_telefono() {
    let tel = "";

    for(let i = 0; i < 7; i++)
        tel += Math.floor(Math.random() * 10);
    return tel;
}

function random_item(list) {
    let len = list.length;
    return list[Math.floor(Math.random() * len)];
}

